import React from "react";
import dayjs from "dayjs";
import axios from "axios";

export default function VisitsTableData(props) {
    return(
    <>
        <ul>
        { props.visitors.map((visitor, index) => (
            <li key={ index }>{ visitor.name }</li>
        )) }
        </ul>
    </>
        );
}
